syntax = "proto3";
option csharp_namespace = "YSFreedom.Common.Protocol";

import "ItemParam.proto";

message TakeCityReputationLevelRewardRsp {
	enum CmdId {
		option allow_alias = true;
		NONE = 0;
		ENET_CHANNEL_ID = 0;
		ENET_IS_RELIABLE = 1;
		CMD_ID = 2804;
	}

	int32 retcode = 1;
	uint32 city_id = 2;
	uint32 level = 3;
	repeated ItemParam item_list = 4;
}
